INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (214,'058','벌이 봄 동산에 가득 피어 햇살을 머금고 있으니 봄과 나비가 날아들어 희락을 부릴봄과 같습니다. 금년의 운수가 좋으니 반드시 경사스런 일을 것입니다. 만약 경사가 아니더라도 욕을 고치거나 새로운 일로 경영하면 대길하게 될 것입니다. 연초부터 이것은 없더라도 쉽게 풀리겠습니다. 하는 일을 신중을 기해야 합니다. 먼길되이 움직이게 되면 하는 일을 이루기도 전에 실패하기 쉬우니 신중을 기해야 합니다. 만일 이사하지 않으면 흉함이 있을지도 모르니 환경을 바꾸거나 자리를 옮겨보는 것도 좋겠습니다. 작은 것도 큰 것을 이루니 점점 형통해 질 것입니다. 두 사람의 마음이 하나가 되어 일을 위해 노력하게 됩니다. 직성이면 감천이겠습니다.','위아래가 화목하여 집안이 화평하고 태평할 것입니다. 상하의 조화가 태평의 기본입니다. 청룡이 여의주를 물고 희락하고 있으니 반드시 학연하거나 좋은 연인을 만날 수가 있겠습니다. 만약 이럭 같지 않으면 자손에게 경사가 있겠습니다.','재운이 사라지고 복이 돌아오니 만사가 태평하여 즐거움을 누리게 되겠습니다. 분수를 지키고 편안하게 안주한다면 복력이 스스로 굴러올 것입니다. 소망이 여의하여 뜻과 같이 성취되리니 가히 큰 재물도 얻을 수 있겠습니다.','만일 후운수가 아니라면 결혼을 하거나 연인을 만나 즐거움을 누리겠습니다. 운성이 몸에 따르니 날로 큰 재물을 얻게 될 것입니다. 이는 사람을 잘 대하고 수를 조심하는 여유를 부릴이니 사아갈 기회가 그 가운데 있음입니다.','작은 것이 가고 큰 것이 돌아오니 호를 잡아서 큰산을 이룸과 같습니다. 은혜를 입어 상직을 일으킨 운수이니 부유하기가 마치 흙들림 없는 땅을 삼킴함과 다르지 않을 만큼 튼튼합니다. 운성이 문에 비치니 후운할 운수입니다.','구름이 흐려지고 달이 나타나니 천지가 먼날해져서 앞길이 환하게 들여다볼 것입니다. 다행하게도 귀인을 만나게 된다면 영화한 빛깔이 다섯 배나 더하겠습니다. 집안이 화평하고 마음이 안락하니 이보다 좋은 일이 또 있겠습니까?','만일 과거에 급제하지 않으면 과거에 실하에 경사가 있으리니 이 또한 기쁨입니다. 어디를 향하는 사람이 우연히 횡부를 얻었으니 어둘을 물리친과 같습니다. 이르는 곳마다 재물이 있고 백가지 일마다 다 길하니 모두 성숙깊 일한 때입니다.','님이 물결하고 권리가 많으니 사람들이 우러러보고 칭찬이 자자합니다. 길성이 문에 비치니 필시 가정에 경사가 있어 모두 기쁘게 될 것입니다. 만약 후운가 아니면 자손이 부귀하고 영화롭게 될 것입니다.','꿋꿋하는 일을 속히 도모해야 합니다. 너무 뜸을 들이게 되면 도리어 불리합니다. 잘 못 사귄 사람으로부터 해로움이 미칠 수 있으니 주의하십시오. 음양이 화합하니 반드시 경사가 있게 될 것입니다.','하늘이 복을 주니 백가지 일을 다 이루게 되는 행운을 맞이할 수 있습니다. 이런 복은 사람을 잘 사귀어대서 비롭된 것이니 가히 사귀어서 후운를 얻게 될 것입니다. 소망이 여의하여 뜻대로 이루어지게 되니 세상일이 태평하기만 됩니다.','마음을 바로하고 뜻을 잘 뜰으면 복력이 스스로 들어오겠습니다. 다른 사람들과 화목하게 지내며 재물을 구하면 반드시 모든 일이 동시에 이룰될 것입니다. 이 달의 운수는 구설수를 조심하고 남의 시비를 염려봐서는 안됩니다.','봄 동산에 꽃들이 때를 만나 만발한 것처럼 드디어 모든 일들이 활짝 열리게 됩니다. 재력이 몸에 임했으니 뜻밖에 후운하는 기쁨을 맞이하겠습니다. 필시 실하에 경사가 있으리니 집안에 활기가 충만할 것입니다. 이 또한 기쁨이겠습니다.','서천에 길함이 있으니 반드시 재물을 북쪽에서 얻을 것입니다. 마무리를 잘 지으십시오 마음이 안락하고 편안한데 어찌 매사가 뜻함 여의하지 못하겠습니까. 다른 말을 들어서는 안됩니다. 잘 되는 일에 염히려 이것이 없을 것입니다.','2025-03-02 12:01:03.018739+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (427,'058','蜜蜂在春季花园里充满了阳光，所以春天和蝴蝶就像春天。今年的运气很好，所以它将被倾斜。如果您不倾向，您将能够修复咒骂或运行新事物。从今年年初开始，如果没有这个，它将很容易解决。您必须小心自己的工作。如果您走很长一段路，那么在做自己的事情之前很容易失败。如果您不动，您可能会很丑陋，因此改变环境或移动座位是个好主意。小家伙会很大，因此它将变得越来越繁荣。两个人的心成为一个人，试图工作。如果是一个职位，那将是Gamcheon。','上下将和解，房屋将是和平与和平的。上下的和谐是跆拳道的基础。蓝龙正在咬Yeouiju，因此您可以学习好恋人或好恋人。如果不是这样，后代将倾向于。','随着运气消失，祝福又回来了，一切都会令人愉快。如果您保持喷泉并安顿下来，那么电源将自己滚动。希望会得到充实，因此您可以获得大量财富。','如果不是kidf，我将结婚或遇到情人。团结将跟随您的身体，因此您将获得巨大的财富。这是一个好购买人并注意这个数字的机会。','小的走了，大的人回来了，所以我抓住了弧线，大山就像一个房间。这是一个引起恩典并导致商业位置的运气，因此富裕与吞下无地土地没有什么不同。 Unsung在门口，所以很幸运。','随着云层的模糊和月亮出现，天地将遥远，因此道路看起来明亮。幸运的是，如果您遇到了贵族，这部电影将是五倍。有什么比这更好的，因为房子和平与舒适？','如果您过去不付款，过去会有一个坡度。无论您身在何处，都会意外获得传播，所以这就像失败。到处都有财富，每百天都很长。','因为您有很多权利，所以人们正在抬起头来赞美。由于道路在门上，因此很高兴感到高兴，因为家里有一个斜坡。如果没有，后代将是富有而高兴的。','您需要尽快促进您的工作。如果您得到的太多，那您是不利的。要小心，因为它对那些不擅长的人可能是有害的。阴和阳肯定会倾向于。','天空是有福的，因此您可以幸运地取得一百件事。这种祝福是使人们变得良好的一件好事，因此您将聚在一起获得巨大。希望是由希望来实现的，所以世界是和平的。','如果您正确地做自己的心，并且您会擅长的，那么您的力量就会出现。如果您与他人和谐相处并获得财富，那么一切都将同时完成。这个月的运气不应谨慎对待古苏尔，并担心别人的受精。','好像花在春季花园里盛开，一切终于打开了。我会带来意外的快乐。下面会有一个斜坡，因此房屋将充满活力。这也是一种快乐。','Seocheon有一段时间，因此您一定会从北部获得财富。请做一个良好的完成。我的心舒适舒适。不要听其他话。这不会为了做事而做。','2025-03-02 12:01:03.018739+00','c');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (498,'058','ミツバチは春の庭の日差しで満たされているので、春と蝶は春のようなものです。今年の運は良いので、傾斜します。傾向がない場合は、宣誓を修正したり、新しいことを実行したりすることができます。今年の初めから、これなしでは簡単に解決されます。あなたは自分がしていることに注意する必要があります。長い道のりを動かすと、自分がすることをする前に失敗するのは簡単です。動かなければ、醜いかもしれないので、環境を変えたり、座席を動かしたりすることをお勧めします。小さなものは大きくなるので、ますます繁栄します。二人の心が一人になり、仕事をしようとします。それがポジションである場合、それはGamcheonになります。','上下は和解し、家は平和で平和になります。上下の調和はTaepyeongの基礎です。ブルードラゴンはヨウイジュを噛んでいるので、あなたは良い恋人や良い恋人を学ぶことができます。このようでなければ、子孫は傾いています。','運が消え、祝福が戻ってくると、すべてのものが楽しむのが楽しいでしょう。噴水を維持し、快適に落ち着くと、力は自分で転がります。希望はそのまま満たされるので、あなたは大きな富を得ることができます。','それがReacefでない場合、私は結婚するか、恋人に会います。団結はあなたの体に従うので、あなたは大きな富を得るでしょう。これは、人をよく購入し、その数に注意するチャンスです。','小さなものが行き、大きなものが戻ってくるので、私は弧を描きました、そして、大きな山は部屋のようです。それは恵みを引き起こし、商業的な位置を引き起こす運であるため、金持ちは地球のない土地を飲み込むことと変わりません。 Unsungがドアにいるので、それは運です。','雲がぼやけて月が現れると、天と地は遠く離れているので、道路は明るく見えます。幸いなことに、あなたがノーブルに出会えば、映画はそれ以上の5倍になります。家は平和で快適なので、これより良いものはありますか？','過去に支払わないと、過去に斜面があります。どこにいても、誤ってトランスミッションを取得するので、それは敗北のようなものです。どこにでも富があり、100日ごとに長いです。','あなたには多くの権利があるので、人々は見上げて賞賛しています。道はドアにあるので、家に斜面があるので喜んで喜んでいます。そうでない場合、子孫は金持ちで喜んでいます。','できるだけ早く仕事を宣伝する必要があります。あなたが多すぎると、あなたは不利です。それが得意ではない人からは有害である可能性があるため、注意してください。陰と陽はきっと傾いているでしょう。','空は祝福されているので、あなたは幸運にも100のことを達成することができます。この祝福は人々を上手にするのに良いことなので、あなたは集まって巨大になります。希望は希望によって行われるので、世界は平和です。','あなたがあなたの心を正しくして、あなたがそれが得意であるならば、あなたの力は入ります。あなたが他の人と調和して生きて富を得るならば、すべてが同時に行われます。今月の運は、ガスルに注意して、他人の受精について心配するべきではありません。','まるで春の庭で花が満開になっているかのように、すべてが最終的に開いています。私は予想外の喜びを持っています。下に斜面があるので、家は活力に満ちています。これも喜びです。','ソチョンには長さがあるので、北から豊かさを確実に得るでしょう。良い仕上げをしてください。私の心は快適で快適です。他の言葉を聞かないでください。これは物事を行うために行われません。','2025-03-02 12:01:03.018739+00','j');
